  return (

    <div>
      <head>
        <link href='https://fonts.googleapis.com/css?family=Almendra SC' rel='stylesheet'></link>
      </head>
      <body>
        <h1 class ='glowpulsed'>Munchkin</h1>
        <div></div>
        <Button animated className='startButt'>
          <Button.Content visible>Start Game</Button.Content>
          <Button.Content hidden>
        <Icon name='bomb' />
      </Button.Content>
    </Button>
      </body>
    </div>

  );
}

export default App;
